import "./about.css"

export default function about() {
  return (
    <div className="sumblog">
        <h1 className="sumblogH">Willkommen bei Pick a Petal - unser Zimmerpflanzen-Blog!</h1>
      <p className="sumblogP"> In diesem digitalen Paradies tauchen wir ein in die faszinierende Welt der Zimmerpflanzen, die nicht nur unsere Räume verschönern, sondern auch unser Wohlbefinden steigern. Als Teil eines spannenden Uniprojektes zur Gestaltung einer Website rund um das Thema Zimmerpflanzen, laden wir dich ein, gemeinsam mit uns die Vielfalt, Pflegehinweise und die positiven Auswirkungen von Zimmerpflanzen zu entdecken. Tauche ein in die Welt des Grüns, lass dich inspirieren und erfahre alles Wissenswerte über diese grünen Mitbewohner, die unsere Wohnräume in wahre Wohlfühloasen verwandeln können. Freue dich auf informative Beiträge, praktische Tipps und jede Menge Inspiration für deine persönliche Pflanzensammlung! </p>
    </div>
  )
}
